import React from "react";
import './App.css';

import Header from './components/Header';
import Signup from './components/signup';
import {BrowserRouter as Router, Route} from "react-router-dom";

function App() {
  return (
    <Router>
     <div>
      <Header/>
      <Route path="/signup" exact Component={Signup}></Route>
     </div>
    </Router>
  );
}

export default App;
